import React from 'react'
import './form-input.styles.scss'


const FormInput = ({ label, handleChange, ...otherProps }) => (
    <div className='group'>
        <input className='form-input' onChange={handleChange} {...otherProps} /> <br/>
        <label>{label}</label>
 
    </div>
)

export default FormInput;
